int inorder(Node *root)
{
    int cnt = 0;
    Node *curr, *prev;
    curr = root;
    while (curr)
    {
        if (!curr->left)
        {
            // cout << curr->data << endl;
            curr = curr->right;
            cnt++;
        }
        else
        {
            prev = curr->left;
            while (prev->right and prev->right != curr)
            {
                prev = prev->right;
            }
            if(!prev->right){
                prev->right = curr;
                curr = curr->left;
            }else{
                prev->right = nullptr;
                cnt++;
                // cout << curr->data << endl;
                curr = curr->right;
            }
        }
    }
    return cnt;
}
float findMedian(struct Node *root)
{
    int n = inorder(root);
    // cout<<n<<endl;
    float median = 1e8;
    set<int> dp;
    if(n&1)
        dp.insert(n/2);
    else{
        dp.insert(n/2);
        dp.insert(-1 + (n)/2);
    }
    int cnt = 0;
    Node *curr, *prev;
    curr = root;
    while (curr)
    {
        if (!curr->left)
        {
            if(dp.find(cnt) != dp.end()){
                // cout<<curr->data<<endl;
                if(median == 1e8){
                    median = curr->data;
                }else{
                    median = (median + curr->data)/(float)2;
                }
            }
            curr = curr->right;
            cnt++;
        }
        else
        {   
            prev = curr->left;
            while (prev->right and prev->right != curr)
            {
                prev = prev->right;
            }
            if(!prev->right){
                prev->right = curr;
                curr = curr->left;
            }else{
                prev->right = nullptr;
                if(dp.find(cnt) != dp.end()){
                    if(median == 1e8){
                        median = curr->data;
                    }else{
                        median = (median + curr->data)/(float)2;
                    }
                }
                cnt++;
                curr = curr->right;
            }
        }
    }
    return median;
}
